import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as i,e as l}from"./app-a1fbcbb6.js";const e={},a=l('<h2 id="举例" tabindex="-1"><a class="header-anchor" href="#举例" aria-hidden="true">#</a> 举例</h2><ul><li>手机有很多功能, &quot;开机&quot;,&quot;关机&quot;,&quot;打电话&quot;,&quot;发短信&quot;,&quot;拍照&quot;等等</li><li>手机中的每一个功能就相当于 C 语言程序中的一个程序段(函数)</li><li>众多功能中总有一个会被先执行,不可能多个功能一起执行</li><li>想使用手机必须先执行手机的开机功能</li><li>所以 C 语言程序也一样,由众多功能、众多程序段组成, 众多 C 语言程序段中总有一个会被先执行, 这个先执行的程序段我们称之为&quot;主函数&quot;</li></ul><h2 id="c-语言" tabindex="-1"><a class="header-anchor" href="#c-语言" aria-hidden="true">#</a> C 语言</h2><ul><li>一个 C 语言程序由多个&quot;函数&quot;构成,每个函数有自己的功能</li><li>一个程序<strong>有且只有一个主函数</strong></li><li>如果一个程序没有主函数,则这个程序不具备运行能力</li><li>程序运行时系统会<strong>自动调用</strong>主函数,而其它函数需要开发者<strong>手动调用</strong></li><li>主函数有固定书写的格式和范写<br><img src="https://img-blog.csdnimg.cn/img_convert/ceee2f6f48a92f5d8a0239a7311330f5.png" alt="" loading="lazy"></li></ul>',4),r=[a];function n(c,s){return o(),i("div",null,r)}const h=t(e,[["render",n],["__file","06.html.vue"]]);export{h as default};
